import React from "react";

const styles = {
  right: {
    display: "flex",
    backgroundColor: "blue",
    height: "100vh",
    width: "50%",
  },
  container: {
    marginLeft: "30px",
    marginTop: "30px",
    fontWeight: "bold",
  },
  a: {
    display: "block",
    marginBottom: "10px",
    textDecoration: "none",
    color: "black",
    fontSize: "20px",
  },
};

function About() {
  return (
    <div style={styles.right}>
      <h1>About</h1>
      <p>This is the About page.</p>
    </div>
  );
}

export default About;
